import Vue from 'vue';
import VueRouter from 'vue-router';
import HomePage from './components/HomePage.vue';
import App from './App.vue';
import StartPage from './components/StartPage.vue';
Vue.use(VueRouter);
const router = new VueRouter({
  routes: [{
    path: '/',
    component: StartPage
  }, {
    path: '/home',
    component: HomePage
  }],
  mode: 'history'
});
new Vue({
  router,
  render: h => h(App)
}).$mount('#app');
